import styled from "styled-components";

const ModalStyled = styled.div`
  display: flex;
  position: fixed;
  top: 25%;
  left: 50%;
  transform: translate(-50%);
  width: 500px;
  height: 500px;
  z-index: 3;
  border: 1px solid red;
`;

export default ModalStyled;
